INSERT INTO "app_patient_admission_service_i18n" ("id", "entity_id", "locale", "name", "description", "slug") VALUES
(9,	27,	'fr_FR',	'Consultation médicale',	'<p>Ce service est dirig&eacute; par des m&eacute;decins sp&eacute;cialistes du VIH/sida qui effectuent les &eacute;valuations m&eacute;dicales initiales, prescrivent des traitements antir&eacute;troviraux (ARV) et fournissent un suivi r&eacute;gulier pour surveiller la progression de la maladie et ajuster les traitements si n&eacute;cessaire.</p>',	NULL),
(10,	27,	'en_EN',	'Medical consultation ',	'<p>Ce service est dirig&eacute; par des m&eacute;decins sp&eacute;cialistes du VIH/sida qui effectuent les &eacute;valuations m&eacute;dicales initiales, prescrivent des traitements antir&eacute;troviraux (ARV) et fournissent un suivi r&eacute;gulier pour surveiller la progression de la maladie et ajuster les traitements si n&eacute;cessaire.</p>',	NULL),
(11,	28,	'en_EN',	'Nursing follow-up',	'<p>Les infirmiers sp&eacute;cialis&eacute;s dans le VIH peuvent &ecirc;tre responsables de l''administration des traitements, de l''&eacute;ducation des patients sur la gestion de leur maladie, de la pr&eacute;vention des infections opportunistes, et de la fourniture de soutien &eacute;motionnel et psychosocial.</p>',	NULL),
(12,	28,	'fr_FR',	'Suivi infirmier',	'<p>Les infirmiers sp&eacute;cialis&eacute;s dans le VIH peuvent &ecirc;tre responsables de l''administration des traitements, de l''&eacute;ducation des patients sur la gestion de leur maladie, de la pr&eacute;vention des infections opportunistes, et de la fourniture de soutien &eacute;motionnel et psychosocial.</p>',	NULL),
(13,	29,	'en_EN',	'Advice and screening',	'<p>Ce service offre des conseils et des tests de d&eacute;pistage du VIH pour les personnes qui veulent conna&icirc;tre leur statut s&eacute;rologique. Ils fournissent &eacute;galement des informations sur la pr&eacute;vention du VIH et peuvent orienter les personnes vers d''autres services de sant&eacute; si n&eacute;cessaire.</p>',	NULL),
(14,	29,	'fr_FR',	'Conseil et dépistage',	'<p>Ce service offre des conseils et des tests de d&eacute;pistage du VIH pour les personnes qui veulent conna&icirc;tre leur statut s&eacute;rologique. Ils fournissent &eacute;galement des informations sur la pr&eacute;vention du VIH et peuvent orienter les personnes vers d''autres services de sant&eacute; si n&eacute;cessaire.</p>',	NULL),
(15,	30,	'fr_FR',	'Services de soutien psychologique et social',	'<p>Ces services offrent un soutien psychologique, &eacute;motionnel et social aux personnes vivant avec le VIH, ainsi qu''&agrave; leurs familles et &agrave; leurs aidants. Cela peut inclure des s&eacute;ances de conseil individuel ou en groupe, des groupes de soutien, des services d''aide aux b&eacute;n&eacute;ficiaires, et des programmes de r&eacute;duction des risques.</p>',	NULL),
(16,	30,	'en_EN',	'Psychological and social support services',	'<p>Ces services offrent un soutien psychologique, &eacute;motionnel et social aux personnes vivant avec le VIH, ainsi qu''&agrave; leurs familles et &agrave; leurs aidants. Cela peut inclure des s&eacute;ances de conseil individuel ou en groupe, des groupes de soutien, des services d''aide aux b&eacute;n&eacute;ficiaires, et des programmes de r&eacute;duction des risques.</p>',	NULL),
(17,	31,	'en_EN',	'Mental health services',	'<p>Certains centres de traitement du VIH offrent des services sp&eacute;cialis&eacute;s en sant&eacute; mentale pour aider les personnes vivant avec le VIH &agrave; faire face aux d&eacute;fis psychologiques et &eacute;motionnels associ&eacute;s &agrave; leur diagnostic.</p>',	NULL),
(18,	31,	'fr_FR',	'Services de santé mentale',	'<p>Certains centres de traitement du VIH offrent des services sp&eacute;cialis&eacute;s en sant&eacute; mentale pour aider les personnes vivant avec le VIH &agrave; faire face aux d&eacute;fis psychologiques et &eacute;motionnels associ&eacute;s &agrave; leur diagnostic.</p>',	NULL),
(19,	32,	'en_EN',	'Screening and treatment services for opportunistic infections',	'<p>Ces services sont charg&eacute;s de d&eacute;pister et de traiter les infections opportunistes qui peuvent survenir chez les personnes vivant avec le VIH en raison de leur syst&egrave;me immunitaire affaibli.</p>',	NULL),
(20,	32,	'fr_FR',	'Services de dépistage et de traitement des infections opportunistes',	'<p>Ces services sont charg&eacute;s de d&eacute;pister et de traiter les infections opportunistes qui peuvent survenir chez les personnes vivant avec le VIH en raison de leur syst&egrave;me immunitaire affaibli.</p>',	NULL),
(21,	33,	'fr_FR',	'Pharmacie',	'<p>N''est pas un service en tant que tel, mais un patient peut y &ecirc;tre redirig&eacute; directement, si ces m&eacute;dicaments ne sont pas termin&eacute;s</p>',	NULL),
(22,	33,	'en_EN',	'pharmacy',	'<p>N''est pas un service en tant que tel, mais un patient peut y &ecirc;tre redirig&eacute; directement, si ces m&eacute;dicaments ne sont pas termin&eacute;s</p>',	NULL);
